INSERT INTO faqs (id, product_id, title, title_mm, desc, desc_mm, created_at, updated_at) VALUES ('23','12','7. Can I transfer my NCB entitlement from one car to another and from another insurance company?','','Yes, if the cars are registered in your name, the transfer of NCB earned can be allowed but always bear in mind that you can only enjoy the next level of NCB if your car is insured with the same insurer continuously for a period of 12 months and provided there is no claim made or intimated under your policy in each of the above instances. (Note: You cannot use the same NCB earned to more than one car. NCB is on earned basis by each car upon completion of the continuous 12 months period of insurance with the same insurer. You can transfer your NCB to any car registered in your name as explained above.)','','2023-10-24 07:39:37','2024-01-18 17:05:31');
INSERT INTO faqs (id, product_id, title, title_mm, desc, desc_mm, created_at, updated_at) VALUES ('24','12','2. Do all insurance companies charge the same premium?','','Motor Vehicle Insurance is tariff rated i.e., the premium for that cover is being computed based on a formula determined by the insurance authority. This means that all insurance companies are charging the same basic premium for the same cover.','','2023-10-24 07:46:40','2024-01-18 17:04:07');
INSERT INTO faqs (id, product_id, title, title_mm, desc, desc_mm, created_at, updated_at) VALUES ('25','12','8. What should I do if I want to change my car?','','You should contact AYA SOMPO Customer Service – 09 777 100 555 or respective sale staffs for changing a vehicle. You would need to fill in the [endorsement form](https://ayasompo.com/wp-content/uploads/2023/10/AYA-OPD-RE-093-Motor-Vehicle-Insurance-Endorsement-Request-Letter.pdf) and provide the required documents for your new vehicle. The refund or additional premium will be charged depending on your new SI.','','2023-10-24 07:47:34','2024-01-18 17:05:57');
INSERT INTO faqs (id, product_id, title, title_mm, desc, desc_mm, created_at, updated_at) VALUES ('26','12','3. What is an excess and can you illustrate an example of its application?','','An excess is the amount the Insured will have to bear before the insurance company will pay for each and every claim made. For example, if the claim amount is 160,000 MMK and the excess stated on the policy is 100,000 MMK, the amount payable to the Insured will be 60,000 MMK .','','2023-10-24 07:47:58','2024-01-18 17:04:21');
INSERT INTO faqs (id, product_id, title, title_mm, desc, desc_mm, created_at, updated_at) VALUES ('27','12','9. What is an excess and can you illustrate an example of its application?','','An excess is the amount the Insured will have to bear before the insurance company will pay for each and every claim made. For example, if the claim amount is 160,000 MMK and the excess stated on the policy is 100,000 MMK, the amount payable to the Insured will be 60,000 MMK .','','2023-10-24 07:48:57','2024-01-18 17:06:26');
INSERT INTO faqs (id, product_id, title, title_mm, desc, desc_mm, created_at, updated_at) VALUES ('28','12','4. What should I do if I want to cancel my policy?','','You should contact AYA SOMPO Customer Service – 09 777 100 555 or respective sale staffs for cancellation process. You would need to fill in the [cancellation form](https://ayasompo.com/wp-content/uploads/2023/10/AYA-OPD-RE-092-Motor-Vehicle-Insurance-Cancellation-Request-Form.pdf). The premium will be refunded depending on the remaining insurance period.','','2023-10-24 07:49:40','2024-01-18 17:04:35');
INSERT INTO faqs (id, product_id, title, title_mm, desc, desc_mm, created_at, updated_at) VALUES ('29','12','10. What is No Claim Bonus (NCB) entitlement?','','NCB entitlement is a discount allowed to the Insured in accordance with a scale determined by the authority, a certain percentage off the basic premium if no claim is made or intimated under the insured's policy and also provided the vehicle is insured continuously for a period of 12 months with the same insurer.','','2023-10-24 07:49:59','2024-01-18 17:08:37');
INSERT INTO faqs (id, product_id, title, title_mm, desc, desc_mm, created_at, updated_at) VALUES ('30','12','5. What is Betterment?','','If new original parts are used to repair your vehicle and your vehicle results in a better condition than it was before the damage, you would be required to contribute to its betterment, a proportion of the costs of such new original parts. If **No Betterment** additional cover is purchased by additional premium, the costs of such new original parts will be contributed only by the insurer.','','2023-10-24 07:50:24','2024-01-18 17:04:53');
INSERT INTO faqs (id, product_id, title, title_mm, desc, desc_mm, created_at, updated_at) VALUES ('31','12','11. How much should I insure my car?','','You should insure your car on its market value. You can seek local car dealers or showrooms to determine the value of your car.','','2023-10-24 07:50:49','2024-01-18 17:09:05');
INSERT INTO faqs (id, product_id, title, title_mm, desc, desc_mm, created_at, updated_at) VALUES ('32','12','6. What is Additional Excess?','','Coverage to enjoy premium discount by contributing additional excess amount at the time of claim happens.','','2023-10-24 07:51:06','2024-01-18 17:05:07');
INSERT INTO faqs (id, product_id, title, title_mm, desc, desc_mm, created_at, updated_at) VALUES ('33','14','1. What is the Period of Cover?','','Duration of cover ranges from 1 day to a maximum of 31 consecutive days.','','2023-10-24 08:15:28','2024-01-18 16:46:18');
INSERT INTO faqs (id, product_id, title, title_mm, desc, desc_mm, created_at, updated_at) VALUES ('34','14','5. When does the period of insurance start?','','Period of insurance starts when you leave your home or starting point of journey in your Home Territory (provided the cover does not commence more than 24 hours prior to the scheduled departure time or cease more than 24 hours after the scheduled arrival at your Home Territory) to the time you return to your Home Territory or the expiry of the Period of Insurance, whichever is earlier.','','2023-10-24 08:15:41','2024-01-18 17:01:55');
INSERT INTO faqs (id, product_id, title, title_mm, desc, desc_mm, created_at, updated_at) VALUES ('35','14','2. What is the premium payment type?','','Premium should be paid in lump sum.','','2023-10-24 08:15:57','2024-01-18 16:46:45');
