INSERT INTO faqs (id, product_id, title, title_mm, desc, desc_mm, created_at, updated_at) VALUES ('45','14','8. What are some of the key terms and conditions that I should be aware of?','','Duty Of Disclosure Where the Insured person has applied for this Insurance wholly for purposes unrelated to lnsured person’s trade, business or profession, Insured person had a duty to take reasonable care not to make a misrepresentation in answering the questions in the Proposal Form (or when Insured person applied for this insurance). Insured person should have answered the questions fully and accurately. Failure to have taken reasonable care in answering the questions may result in avoidance of Life lnsured person’s contract of insurance, refusal or reduction of claim(s), change of terms or termination of contract of insurance. Insured person was also required to disclose any other matter that the Insured person knew to be relevant to The Company’s decision in accepting the risks and determining the rates and terms to be applied. Insured person also have a duty to tell The Company immediately if at any time after Life insured person’s contract of insurance has been entered into, varied or renewed with The Company any of the information given in the Proposal Form (or when Life Insured applied for this insurance) is inaccurate or has changed.','','2023-10-24 08:24:29','2024-01-18 17:03:30');
