INSERT INTO faqs (id, product_id, title, title_mm, desc, desc_mm, created_at, updated_at) VALUES ('47','18','1. What is an Industrial All Risks (IAR) insurance?','','Industrial All Risks cover not only all the “ named perils” of fire insurance but also extends to cover “ accidental damage” which could not be covered under fire insurance, only subject to specific exclusions of the policy. It also covers for sudden and unforeseen loss by any perils other than by exclusions.','','2023-11-13 08:23:30','2024-01-18 16:13:36');
INSERT INTO faqs (id, product_id, title, title_mm, desc, desc_mm, created_at, updated_at) VALUES ('48','18','3. Difference between Fire Insurance and Industrial All Risks (IAR)','','Fire insurance covers losses from accidental fire, infectious fire, lightning, domestic gas explosion.   Industrial All Risks insurance covers all perils unless the peril is excluded in policy.','','2023-11-13 08:23:56','2024-01-18 16:14:15');
INSERT INTO faqs (id, product_id, title, title_mm, desc, desc_mm, created_at, updated_at) VALUES ('49','18','2. What can be insured?','','All buildings, all machineries, all furniture and stocks in the premises.','','2023-11-13 08:24:19','2024-01-18 16:13:56');
